import React, { Component, useState } from "react";
import "./Home.css";
import { stringify } from "querystring";
import {bankInformation ,
bankDeposit,
bankwithdraw
} from "../Services/bankServices";

class Home extends Component {
  state = {
    deposit: "",
    withdraw: ""
  };
  reqBody = {
 deposit: "",
 withdraw: ""
  };
  constructor() {
    super();
    this.state = {
      isInformationDialogOpen: false,
      isRemoveDialogOpen: false,
      isBalanceDialogOpen: false
    };
  }

  async onClickDeposit() {
      this.reqBody.deposit = this.state.deposit;
      console.log(this.reqBody.deposit);
      this.reqBody.name = this.props.location.state.name; 
      try {
        await bankDeposit(this.reqBody);
      } catch (error) {
        if (error.response.status === 404) {
          alert("NotFound");
        }
      }
    }

  async onClickWithdraw() {
      this.reqBody.withdraw = this.state.withdraw;
      console.log(this.reqBody.withdraw);
      this.reqBody.name = this.props.location.state.name; 
      try {
        await bankwithdraw(this.reqBody);
      } catch (error) {
        if (error.response.status === 404) {
          alert("NotFound");
        }
      }
    }
    edit() {
      let path = "/edit";
      this.props.history.push({
        pathname: path,
        state: {
          email: this.props.location.state.email
        }
      });
    }
    home() {
      let path = "/home";
      this.props.history.push(path);
    }

  openInformationDialog = () =>
    this.setState({ isInformationDialogOpen: true });
  // handleRemoveClose = () => this.setState({ isRemoveDialogOpen: false });
  // openRemoveDialog = () => this.setState({ isRemoveDialogOpen: true });
  //openBalanceDialog = () => this.setState({ isBalanceDialogOpen: true });
  // openInformationDialog = () => this.setState({ isInformationDialogOpen: true });
  // openRemoveDialog = () => this.setState({ isRemoveDialogOpen: true });
  openBalanceDialog = () => this.setState({ isBalanceDialogOpen: true });

  handleInformationClose = () =>
    this.setState({ isInformationDialogOpen: false });
  // handleRemoveClose = () => this.setState({ isRemoveDialogOpen: false });
  handleBalanceClose = () => this.setState({ isBalanceDialogOpen: false });
  async onClick(){

      try{
        await bankInformation(this.reqBody);
      }
      catch(error){
        if (error.response.status === 404) {
          alert("email not found");
        }}}
  render() {
    return (
      <body>
         <div className="navbar">
          <a href="" onClick={() => this.edit()}>
            Edit profile
          </a>
          </div>

        <div>
         <h1 style={{ color : 'red' }}>WELCOME TO OUR BANK

          </h1>
        </div>
        <div>

        </div>
        <div>

        </div>
        <div>

        </div>
        <div></div>
        <div>
          <div className="handle text-right">
            <div>
              <input
                className="search  ml-2 "
                type="text"
                placeholder="Enter a value"
              />
              <button
                className=" depositButton btn btn-primary m-2 "
                id="searchButton"
                onClick={this.onClickDeposit.bind(this)}
              >
                Deposit
              </button>
              <button
                className=" withdrawButton btn btn-primary m-2 "
                id="searchButton"
                onClick={this.onClickWithdraw.bind(this)}
              >
                withdraw
              </button>

                  <div className="userInfo text-light float-left">
                    <em className="accountNumber font-weight-bold h4">
                      Account number:
                    </em>
                    <br />
                    <br />

                    <em className="email font-weight-bold h4">
                      Email:
                    </em>

                    <br />
                    <br />
                    <em className="balance font-weight-bold h4">
                      Balance:
                    </em>

                    <br />
                    <br />
                    <em className="name font-weight-bold h4 pt-3">
                    Name :
                    </em>
                    <br />
                    <br />

                    <em className="cardDate font-weight-bold h4  pd-3  ">
                      Card validity date:
                    </em>
                    <br />
                    <br />

                    <em className="cardNumber font-weight-bold h4  pt-3">
                      Card Number:
                    </em>
                    <br />
                  </div>
            </div>
          </div>
        </div>
      </body>
    );
  }
}

export default Home;
